from datetime import datetime
import json
import os
import urllib.request
import subprocess

os.system("")
FORMAT = {
    'GREEN': '\033[32m',
    'BOLD': '\033[1m',
    'RESET': '\033[0m',
}

def printHeader(text): 
    print(FORMAT['BOLD'] + FORMAT['GREEN'] + '\n' + text + FORMAT['RESET'])

def printBold(text):
    print(FORMAT['BOLD'] + text + FORMAT['RESET'])

def printWithTick(text):
    print(f'{text: <{25}} âœ“')

mc_directory = os.getenv('APPDATA') + '\.minecraft'

###################################################################################################
# INSTALL FABRIC CLIENT
printHeader('Installing Fabric Client')
urllib.request.urlretrieve('https://maven.fabricmc.net/net/fabricmc/fabric-installer/0.11.2/fabric-installer-0.11.2.jar', 'fabric-installer.jar')
subprocess.call(['java', '-jar', 'fabric-installer.jar', 'client', '-dir', mc_directory, '-mcversion', '1.20.1', '-loader', '0.14.21', '-noprofile'])
os.remove('fabric-installer.jar');

###################################################################################################
# DOWNLOAD CLIENT MODS
printHeader('Downloading Mods')
os.makedirs('mods', exist_ok=True)

# Performance and Optimisation
printBold('Performance and Optimisation:')
