printWithTick('Inventory Profiles Next')
# Mouse Tweaks - https://modrinth.com/mod/mouse-tweaks
urllib.request.urlretrieve('https://cdn.modrinth.com/data/aC3cM3Vq/versions/m0Dd8Cjy/MouseTweaks-fabric-mc1.20-2.25.jar', 'mods/mouse-tweaks.jar')
printWithTick('Mouse Tweaks')
