urllib.request.urlretrieve('https://cdn.modrinth.com/data/2M01OLQq/versions/gVxjsEiQ/shulkerboxtooltip-fabric-4.0.4%2B1.20.1.jar', 'mods/shulker-box-tooltip.jar')
printWithTick('Shulker Box Tooltip')

# New Items
printBold('New Functionality:')
# Map Atlases - https://modrinth.com/mod/map-atlases
urllib.request.urlretrieve('https://cdn.modrinth.com/data/C255PPUX/versions/e9Az4uaX/map-atlases-2.6.0%2B1.20.1.jar', 'mods/map-atlases.jar ')
printWithTick('Map Atlases')

# Dependencies
printBold('Dependencies:')
# Fabric API (Inventory Profiles Next, Mouse Tweaks, Shulker Box Tooltip, Map Atlases) - https://modrinth.com/mod/fabric-api
urllib.request.urlretrieve('https://cdn.modrinth.com/data/P7dR8mSH/versions/XheZ9iGK/fabric-api-0.86.1%2B1.20.1.jar', 'mods/fabric-api.jar')
printWithTick('Fabric API')
# Fabric Language Kotlin (Inventory Profiles Next) - https://modrinth.com/mod/fabric-language-kotlin
urllib.request.urlretrieve('https://cdn.modrinth.com/data/Ha28R6CL/versions/s10JMAtS/fabric-language-kotlin-1.10.8%2Bkotlin.1.9.0.jar', 'mods/fabric-language-kotlin.jar')
printWithTick('Fabric Language Kotlin')
# libIPN (Inventory Profiles Next) - https://modrinth.com/mod/libipn
urllib.request.urlretrieve('https://cdn.modrinth.com/data/onSQdWhM/versions/R8cssvoN/libIPN-fabric-1.20-3.0.2.jar', 'mods/libIPN.jar')
printWithTick('libIPN')
# Cloth Config API (Embedded in Shulker Box Tooltip, required for Map Atlases) - https://modrinth.com/mod/cloth-config/
urllib.request.urlretrieve('https://cdn.modrinth.com/data/9s6osm5g/versions/s7VTKfLA/cloth-config-11.1.106-fabric.jar', 'mods/cloth-config-api.jar')
printWithTick('Cloth Config API')
