###################################################################################################
# SETUP CONFIG
printHeader('Configuring Mods')
os.makedirs('config', exist_ok=True)

# Map Atlases config
urllib.request.urlretrieve('https://drive.google.com/uc?export=download&id=1Tsd9V-7ebaYMH5c0rRFZVk6rAlsVdboV', 'config/map_atlases.json5')
printWithTick('Map Atlases')
# Mouse Tweaks config
urllib.request.urlretrieve('https://drive.google.com/uc?export=download&id=1zQNPk_SUxqxLT3MvvO8Ep_ZM5CsGkqbX', 'config/MouseTweaks.cfg')
printWithTick('Mouse Tweaks')
# Inventory Profiles Next config
os.makedirs('config/inventoryprofilesnext', exist_ok=True)
urllib.request.urlretrieve('https://drive.google.com/uc?export=download&id=1A1GghzCLDTcxRciiccE5NfDAyFiut2WY', 'config/inventoryprofilesnext/inventoryprofiles.json')
printWithTick('Inventory Profiles Next')
print('done')

###################################################################################################
# SERVER SETUP
printHeader('Adding Server Details')
urllib.request.urlretrieve('https://drive.google.com/uc?export=download&id=1zPBA7Cj-CFlWODxFuqHHPNtM90m2E4pI', 'servers.dat')
print('done')

###################################################################################################
# LAUNCHER PROFILE
printHeader('Creating Launcher Profile')
launcher_profiles_filepath = mc_directory + '\launcher_profiles.json'

launcher_profile = {
    'lastUsed': datetime.now().isoformat(),
    'lastVersionId': 'fabric-loader-0.14.21-1.20.1',
    'created': datetime.now().isoformat(),
    'name': 'Ourcraft',
    'icon': 'data:image/jpeg;base64,',
    'type': 'custom',
    'gameDir': os.getcwd()
}

with open(launcher_profiles_filepath, 'r+') as f:
    data = json.load(f)
    data['profiles']['test'] = launcher_profile

os.remove(launcher_profiles_filepath)
with open(launcher_profiles_filepath, 'w') as f:
    json.dump(data, f, indent=4)

print('done')
